import React from 'react';

function Map(props) {
    const url = `https://www.google.com/maps/embed/v1/place?q=${props.lat},${props.lng}&key=AIzaSyCYoO74-u8OPkV6kdIzyM0jjG5FEwFVPhw`;
    return (
        <iframe
            title={props.title}
            width="100%"
            height="100%"
            frameBorder="0"
            style={{border:0}}
            src={url}
            zoom="10"
            allowFullScreen
        />
    );
}

 export default Map;
